//Runtime: 212 ms, faster than 5.27% of C++ online submissions for Longest Word in Dictionary through Deleting.
//Memory Usage : 116.6 MB, less than 7.69% of C++ online submissions for Longest Word in Dictionary through Deleting.
class Solution {
public:

	string findLongestWord(string s, vector<string>& d) {
		string result;

		unordered_map<char, list<pair<string, size_t>>> words;
		for (auto w : d)
			words[w[0]].emplace_back(w, 0);

		const size_t n = s.length();
		for (size_t i = 0; i < n; ++i) {
			list<pair<string, size_t>> l;
			l.swap(words[s[i]]);
			for (auto li = begin(l); li != end(l); ++li) {
				if (++li->second == li->first.length()) {
					if (li->first.length() > result.length() ||
						li->first.length() == result.length() && li->first < result)
						result = li->first;
				}
				else
					words[li->first[li->second]].emplace_back(*li);
			}
		}

		return result;
	}
};

